    w = 0
    e = 0
    n1 = 0
    n2 = 0
    n3 = 0
    b1 = 0
    b2 = 0
    b3 = 0

    while true
      printf clear
      y = 0
      while y < height
        x = 0
        while x < width
          i = index(width, x, y)
          z = a[i]
          is_alive = z > 0

          # It's alive
          if is_alive
            printf alive_char
          else
            printf dead_char
          end

          # Mark it
          live_count = 0
          left = x - 1
          right = x + 1
          top = y - 1
          bottom = y + 1
          not_top_row = top >= 0
          not_bottom_row = bottom < height
          not_left_col = left >= 0
          not_right_col = right < width

          # west
          if not_left_col
            w = index(width, left, y)
            west = a[w]
            if west > 0
              live_count = live_count + 1
            else
